// Map users array to reduce lag
const searchableUsers = users.map(user => {
  let searchText = '';

  Object.values(user).forEach(value => {
    if (Array.isArray(value)) {
      searchText += value.join(' ').toLowerCase() + ' ';
    } else {
      searchText += String(value).toLowerCase() + ' ';
    }
  });

  return {
    user,
    searchText: searchText.trim()
  };
});

let overlays = document.querySelectorAll('.overlay-element');

if (overlays.length > 0) {
    overlays.forEach(overlay => overlay.remove())
} else {
    // Shaded Background
    const background = document.createElement('div');
    background.classList.add('overlay-element');
    background.id = 'background';
    document.body.appendChild(background);

    // Modal
    const modal = document.createElement('div');
    modal.classList.add('overlay-element');
    modal.id = 'modal';
    background.appendChild(modal);

    // Title
    const title = document.createElement('h2');
    title.classList.add('overlay-element');
    title.id = 'title'
    title.appendChild(document.createTextNode('FireHawk User Selector'));
    modal.appendChild(title);

    // Close button (x)
    const closeButton = document.createElement('button');
    closeButton.classList.add('overlay-element');
    closeButton.id = 'close-button';
    closeButton.textContent = 'x';
    modal.appendChild(closeButton);

    // Search Bar (Insert Here)
    const searchInput = document.createElement('input');
    searchInput.classList.add('overlay-element');
    searchInput.type = 'text';
    searchInput.placeholder = 'Search users';
    searchInput.id = 'search-input';
    searchInput.setAttribute('autocomplete', 'off');
    modal.appendChild(searchInput);

    // Event Listener for Search
    searchInput.addEventListener('input', function () {
        let filter = searchInput.value;
        renderUsers(filter);
    });

    // User list (table)
    const userList = document.createElement('div');
    userList.classList.add('overlay-element');
    userList.id = 'user-list';
    modal.appendChild(userList);

    // TABLE
    const userListTable = document.createElement('table');
    userListTable.classList.add('overlay-element');
    userList.appendChild(userListTable);

    // THEAD
    const userListThead = document.createElement('thead');
    userListThead.classList.add('overlay-element');
    userListTable.appendChild(userListThead);

    // HEAD TR
    const userListHeadTr = document.createElement('tr');
    userListHeadTr.classList.add('overlay-element');
    userListThead.appendChild(userListHeadTr);

    // HEAD TH
    let headings = ["Name", "ID", "TeamID(s)"]
    headings.forEach(heading =>{
        let userListHeadTh = document.createElement('th');
        userListHeadTh.classList.add('overlay-element');
        userListHeadTh.textContent = heading;
        userListHeadTr.appendChild(userListHeadTh);
    })

		// Render users from map
		function renderUsers(filter = '') {
			let filterText = filter.toLowerCase();
			let fragment = document.createDocumentFragment();

			while (userListTable.rows.length > 1) {
				userListTable.deleteRow(1);
			}

			let count = 0;
			const maxResults = 25;

			searchableUsers.forEach(({ user, searchText }) => {
				if (count >= maxResults) return;

				if (filterText === '' || searchText.includes(filterText)) {
					// Build row as before
					let row = document.createElement('tr');
					row.classList.add('overlay-element');

					Object.entries(user).forEach(([key, value]) => {
						let userListTd = document.createElement('td');
						userListTd.classList.add('overlay-element');

						if (key === 'teamId') {
							value.forEach(item => {
								const link = document.createElement('a');
								link.setAttribute('href', `https://console.firebase.google.com/u/${googleUserNumber}/project/fcrm-e17b0/database/fcrm-e17b0/data/~2Fteams~2F${item}`);

								let teamName = teams.find(team => team.id === item)?.teamName || item;
								link.textContent = teamName;

								userListTd.appendChild(link);
								userListTd.appendChild(document.createElement('br'));
							});
						} else {
							userListTd.textContent = Array.isArray(value) ? value.join(', ') : value;
						}

						row.appendChild(userListTd);
					});

					fragment.appendChild(row);
					count++;
				}
			});

			userListTable.appendChild(fragment);
		}

    // Initial render without filter
    renderUsers();

    //Arrow key controls
    let selectedIndex = 0;

    // Function to update row selection
    function updateSelection(index) {
        const rows = document.querySelectorAll('#user-list table tr:not(:first-child)');
        if (rows.length === 0) return;

        // Remove previous selection
        rows.forEach(row => row.classList.remove('selectedRow'));

        // Ensure index is within bounds
        if (index < 0) index = 0;
        if (index >= rows.length) index = rows.length - 1;

        // Highlight new row
        selectedIndex = index;
        rows[selectedIndex].classList.add('selectedRow');
    }

    // Initial selection
    setTimeout(() => updateSelection(0), 100);

    // Listen for keyboard navigation
    document.addEventListener("keydown", function (event) {
        const rows = document.querySelectorAll('#user-list table tr:not(:first-child)');
        if (rows.length === 0) return;

        if (event.key === "ArrowDown") {
            event.preventDefault();
            updateSelection(selectedIndex + 1);
            document.querySelector('.selectedRow').scrollIntoView({ block: "nearest" });
        } else if (event.key === "ArrowUp") {
            event.preventDefault();
            updateSelection(selectedIndex - 1);
            document.querySelector('.selectedRow').scrollIntoView({ block: "nearest" });
        }
    });

    document.getElementById('search-input').focus();

    // Enter key control
    document.addEventListener('keydown', function (event) {
        const selectedRow = document.querySelector('.selectedRow')
        const selectedTd = selectedRow.querySelector('td:nth-child(2)')

        if (event.key === 'Enter') {
            window.open(`https://console.firebase.google.com/u/${googleUserNumber}/project/fcrm-e17b0/database/fcrm-e17b0/data/~2Fusers~2F${selectedTd.textContent}`, '_blank');
        }
    })

    // Click control (Rows)
    // Single click - Select
    const rows = document.querySelectorAll('#user-list table tr:not(:first-child)');
    rows.forEach(row => {
      row.addEventListener('click', function () {
        if (!row.classList.contains('selectedRow')) {
          document.querySelector('.selectedRow').classList.remove('selectedRow');
          row.classList.add('selectedRow');
        }
      })
    })
    // Double click - Open
    document.addEventListener('dblclick', function () {
      const selectedRow = document.querySelector('.selectedRow')
      const selectedTd = selectedRow.querySelector('td:nth-child(2)')
      window.open(`https://console.firebase.google.com/u/${googleUserNumber}/project/fcrm-e17b0/database/fcrm-e17b0/data/~2Fusers~2F${selectedTd.textContent}`, '_blank');
    })

    //Style
    let head = document.getElementsByTagName('head')[0];
    let style = document.createElement('style');
    style.innerHTML = `
        #background {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background-color: #000000B3;
            z-index: 100000000;
        }

        #modal {
            width: 900px;
            height: 600px;
            top: calc(100vh / 2 - 300px);
            left: calc(100vw / 2 - 450px);
            background-color: #fff;
            position: fixed;
            padding: 15px;
            z-index: 99999999;
            box-sizing: border-box;
        }

        .overlay-element #title {
            font-family: sans-serif;
            font-weight: 700;
            color: #000;
            text-align: center;
            margin: revert;
            box-sizing: content-box;
            line-height: normal;
        }

        #user-list {
            width: 100%;
            overflow: scroll;
            max-height: 480px;
        }

        #user-list table {
            width: 100%;
            border-collapse: collapse;
        }

        #user-list tr {
            height: 30px;
        }

        #user-list tr:nth-child(2n) {
          background-color: #f5f5f5;
        }

        #user-list thead {
            position: sticky;
            top: 0;
            background-color: #fff;
            z-index: 100;
            font-family: sans-serif;
            border-bottom: #aaa
        }

        #user-list td:nth-child(4n-3) {
            width: 30%;
        }

        #user-list td:nth-child(4n-2) {
            width: 40%;
        }

        #user-list td:nth-child(4n-1) {
            width: 30%;
        }

        .selectedRow {
            border-left: 3px solid #005fcc;
            font-weight: bold;
        }

        #user-list td {
          font-family: sans-serif;
          vertical-align: top;
          border-collapse: collapse;
          border-bottom: 1px solid #aaa;
          font-size: 11pt;
          color: #545454;
        }

        .overlay-element #search-input {
          width: 100%;
          font-family: sans-serif;
          font-size: 11pt;
          box-sizing: border-box;
          color: #000;
          background-color: #fff;
          line-height: 20px;
          border: 1px solid #aaa;
          border-radius: 5px;
          margin-top: 2px;
          margin-bottom: 2px;
        }

        .overlay-element #search-input:focus {
          border: 2px solid #005fcc;
          border-radius: 5px;
        }

        #close-button {
          font-family: sans-serif;
          font-size: 14pt;
          color: #000;
          position: absolute;
          top: 0px;
          right: 0px;
          margin: 1px 1px;
          padding: 1px 7px;
          font-weight: 100;
          border: none;
          background-color: transparent;
          appearance: none;
          cursor: pointer;
          line-height: normal;
        }

        #close-button:hover {
          border: 1px solid #ccc;
          padding: 0px 6px 2px 6px;
        }
    `;
    head.appendChild(style);
}

// Escape: Close modal
document.addEventListener('keydown', function(event) {
    if (event.key === 'Escape') {
        document.querySelectorAll('.overlay-element').forEach(overlay => overlay.remove());
    }
});

//Close button: Close modal
const closeButton = document.querySelector('#close-button');
closeButton.addEventListener('click', function () {
    document.querySelectorAll('.overlay-element').forEach(overlay => overlay.remove());
});